description:
Jesus is coming to rule and reign! Amen; Alleluia! We begin our study with the Davidic Covenant and other Biblical prophecy. As we read through REVELATION 19; we see Jesus as King of Kings, and Lord of Lords. True and righteous are His judgments. Herein, we learn the end of the false prophet, antichrist, and remnant of those who have rejected Christ.
Athey Creek Christian Fellowship is a body of believers in Wilsonville Oregon desiring to know the Lord in an ever-increasing measure. We are a non- denominational fellowship associating with all who are in the Body of Christ.  
